        <nav className="navbar is-fixed-top is-light" role="navigation" aria-label="main navigation">
            <div className="navbar-brand has-text-centered">
                <Link href="/">
                    <a className="navbar-item navbar-item-title" href="https://bulma.io">
                        Pokedex
                    </a>
                </Link>
            </div>

            <style jsx>{`
                .navbar-item-title {
                    font-size: 40px;
                }
            `}</style>
        </nav>
    )
}

export default Header
